import '../App.css';
import FormSet from "../Components/FormSet"
import BigHeading from "../Components/BigHeading"

function Login(){
    return(
        <div className=' container '>
            <BigHeading NoImage={true} Title="Login"/>
            <div>
            <FormSet 
                ThirdInput={false} 
                Title=""
                FirstInput="EMAILID"
                SecondInput="EMAIL ID"
            />
            </div>
        </div>
    );
}

export default Login;
